import React, { Component } from 'react'

export default class Collapse extends Component {
    render() {
        return (
            <div>
                <a class="btn btn-primary">
                    {this.props.linkTitle}
                </a>

                <div class="collapse">
                    <div class="card card-body">
                        {this.props.children}
                    </div>
                </div>
            </div>
        );
    }
}
